import React from "react";
import "../style/navbar.css"
const Footer = ({ nombre }) => {
  return (
    <footer>
      <p>Realizado por: <a>ING (c) Santiago Jaramillo Duqe</a> - <a>ING (c)Santiago Mejia Ocampo</a> - ING (c) Rafael Urrea Gaviria</p>
    </footer>
  );
};

export default Footer;
